import React from 'react' 


const ToDoList = (props) => {

    return (
        <ul>
            {props.items.map(item => 
                (
                    <li key={item.name}>
                       <input type="checkbox"  checked={item.checked} />
                        {item.itemName}
                    </li>
                ))}
        </ul>
    )



}











export default ToDoList;
